import Dashboard from "../front_end/pages/Dash_board";
import SignIn from "../front_end/pages/Sign_In";
import SignUp from "../front_end/pages/Sign_Up";
import DeviceStats from "../components/Stats/DeviceStats";
import DeviceNotUsed from "../components/Stats/DeviceNotUsed";
import DeviceUsed from "../components/Stats/DeviceUsed";
import DeviceDamagedStats from "../components/Stats/DeviceDamagedStats";

export const publicRoutes = [
    { path: 'signin', component: SignIn},
    { path: 'signup', component: SignUp},
];

export const FrontendRoute = [
    { path: '', component: Dashboard }, // Empty path for index route
    { path: 'dashboard', component: Dashboard },
    { path: 'deviceStats', component: DeviceStats },
    { path: 'deviceNotUsed', component: DeviceNotUsed },
    { path: 'deviceUsed', component: DeviceUsed },
    { path: 'deviceDamagedStats', component: DeviceDamagedStats }


    // Thêm các route khác nếu cần
];
